INSERT INTO character (id, age, birth_date, gender, name, occupation, portrait_url, status) VALUES (82, 35, null, 'Male', 'Frank Grimes', 'Nuclear Power Plant employee (Sector 7-G) (formerly)', 'https://cdn.thesimpsonsapi.com/500/character/82.webp', 'Deceased');
INSERT INTO phrase (text, character_id) VALUES ('Im not your buddy, Simpson. I dont like you. In fact, I HATE you! Stay the hell away from me, because from now on, were enemies.', 82);
INSERT INTO phrase (text, character_id) VALUES ('Im saying  whats wrong with America, Simpson. You coast through life, you do as little as possible, and you leech off of decent, hardworking people like me. Heh, if you lived in any other country in the world, youd have starved to death long ago. Youre a fraud, a total fraud.', 82);
INSERT INTO phrase (text, character_id) VALUES ('I cant stand it any longer. This whole plant is insane. Insane, I tell you! (stammers, screams)', 82);
INSERT INTO phrase (text, character_id) VALUES ('Whats this? Extremely high voltage. Well, I dont need safety gloves, because Im Homer Simp-!', 82);
INSERT INTO phrase (text, character_id) VALUES ('We wanted to do an episode where the thinking was What if a real life, normal person had to enter Homers universe and deal with him? I know this episode is controversial and divisive, but I just love it. It really feels like what would happen if a real, somewhat humorless human had to deal with Homer. There was some talk [on NoHomers.net] about the ending—we just did that because 1. it’s really funny and shocking, 2. we like the lesson of sometimes, you just cant win—the whole Frank Grimes episode is a study in frustration and hence Homer has the last laugh and 3. we wanted to show that in real life, being Homer Simpson could be really dangerous and life threatening, as Frank Grimes sadly learned.', 82);
